import { TextField, Box, Button } from "@mui/material";
import image from "./images/signUp.png";

function Login() {
    return (
        <>
            <img src={image} alt="login" />
            <Box>
                <TextField variant="standard" />
                <TextField variant="standard" />
                <Button>Login</Button>
            </Box>
        </>
    );
}
export default Login;
